import Gangnam from "../../public/gangnam-style.svg"

const Index = () => {
    return (
        <div style={{textAlign: "center",  marginTop: "20px",}}>
            <img height="300px" src={Gangnam} />
            <p style={{fontWeight: "bold", fontSize: "25px"}}>Welcome to Next Style ...</p>
        </div>
    )
}

export default Index;
